import React from 'react';
import styled from 'styled-components';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import FirstScreen from './screens/FirstScreen';
import LastScreen from './screens/LastScreen';

function App() {
  return (
    <BrowserRouter>
      <nav>
        <Navbar exact to="/"/>
      </nav>

      <Switch>
        <Route path="/">
          <FirstScreen />
        </Route>
        <Route path="/last">
          <LastScreen />
        </Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
